{
  "openrpc": "1.2.4",
  "info": {
    "title": "hyperledger besu JSON-RPC Specification",
    "description": "A specification of the standard interface for Hyperledger Besu clients.",
    "license": {
      "name": "CC0-1.0",
      "url": "https://creativecommons.org/publicdomain/zero/1.0/legalcode"
    },
    "version": "0.0.4"
  },
  "servers": [
    {
      "name": "default local node",
      "url": "http://localhost:8545"
    }
  ],
  "methods": [
    {
      "name": "web3_clientVersion",
      "description": "Returns the version of the current client",
      "summary": "current client version",
      "params": [],
      "result": {
        "name": "clientVersion",
        "description": "client version",
        "schema": {
          "title": "clientVersion",
          "type": "string"
        }
      },
      "examples": [
        {
          "name": "Current client",
          "params": [],
          "result": {
            "name": "node version",
            "value": "besu/v21.7.1/linux-x86_64/adoptopenjdk-java-11"
          }
        }
      ]
    },
    {
      "name": "web3_sha3",
      "summary": "Hashes data",
      "description": "Hashes data using the Keccak-256 algorithm",
      "params": [
        {
          "name": "data",
          "description": "data to hash using the Keccak-256 algorithm",
          "summary": "data to hash",
          "schema": {
            "title": "data",
            "type": "string",
            "pattern": "^0x[a-fA-F\\d]+$"
          }
        }
      ],
      "result": {
        "name": "hashedData",
        "description": "Keccak-256 hash of the given data",
        "schema": {
          "$ref": "#/components/schemas/Keccak"
        }
      },
      "examples": [
        {
          "name": "sha3Example",
          "params": [
            {
              "name": "sha3ParamExample",
              "value": "0x68656c6c6f20776f726c00"
            }
          ],
          "result": {
            "name": "sha3ResultExample",
            "value": "0x5e39a0a66544c0668bde22d61c47a8710000ece931f13b84d3b2feb44ec96d3f"
          }
        }
      ]
    },
    {
      "name": "admin_addPeer",
      "summary": "Adds a static node.",
      "params": [
        {
          "name": "enodeURL",
          "required": true,
          "description": "enode URL of peer to add.",
          "schema": {
            "type": "string"
          }
        }
      ],
      "result": {
        "name": "addPeerResult",
        "description": "true if peer added or false if peer already a static node",
        "schema": {
          "type": "boolean"
        }
      },
      "examples": [
        {
          "name": "addPeerExample",
          "params": [
            {
              "name": "enodeURL",
              "value": "enode://c93f69ddd83d3db3e93e5165d60b4f5d93a9731df776beee94c5f8a0c770e41bdea69094136402db0cef7af63f0aa636ff676d4a88c6d37276dfa4160c21ed5f@127.0.0.1:30303"
            }
          ],
          "result": {
            "name": "addPeerResultExample",
            "value": true
          }
        }
      ]
    },
    {
      "name": "admin_changeLogLevel",
      "summary": "Changes the log level without restarting Besu. You can change the log level for all logs, or you can change the log level for specific packages or classes.\nYou can specify only one log level per RPC call.",
      "params": [
        {
          "name": "level",
          "required": true,
          "description": "log level",
          "schema": {
            "type": "string"
          }
        },
        {
          "name": "log_filter",
          "description": "(optional) packages or classes for which to change the log level",
          "schema": {
            "type": "array",
            "items": {
              "type": "string"
            }
          }
        }
      ],
      "result": {
        "name": "changeLogLevelResult",
        "description": "Success if the log level has changed, otherwise error",
        "schema": {
          "type": "string"
        }
      },
      "examples": [
        {
          "name": "changeLogLevelExample",
          "params": [
            {
              "name": "level",
              "value": "DEBUG"
            }
          ],
          "result": {
            "name": "changeLogLevelResultExample",
            "value": "Success"
          }
        }
      ]
    },
    {
