      "summary": "Returns networking information about the node. The information includes general information about the node and specific information from each running Ethereum sub-protocol (for example, eth).",
      "params": [],
      "result": {
        "name": "nodeInfoResult",
        "description": "node object",
        "schema": {
          "type": "object",
          "properties": {
            "enode": {
              "type": "string"
            },
            "listenAddr": {
              "type": "string"
            },
            "ip": {
              "type": "string"
            },
            "name": {
              "type": "string"
            },
            "id": {
              "type": "string"
            },
            "ports": {
              "properties": {
                "discovery": {
                  "type": "number"
                },
                "listener": {
                  "type": "number"
                }
              }
            },
            "protocols": {
              "type": "object",
              "properties": {
                "eth": {
                  "type": "object",
                  "properties": {
                    "config": {
                      "type": "object",
                      "properties": {
                        "chainId": {
                          "type": "number"
                        },
                        "petersburgBlock": {
                          "type": "number"
                        },
                        "contractSizeLimit": {
                          "type": "number"
                        },
                        "ethash": {
                          "type": "object",
                          "properties": {
                            "fixeddifficulty": {
                              "type": "number"
                            }
                          }
                        }
                      }
                    },
                    "difficulty": {
                      "type": "number"
                    },
                    "genesis": {
                      "type": "string"
                    },
                    "head": {
                      "type": "string"
                    },
                    "network": {
                      "type": "number"
                    }
                  }
                }
              }
            }
          }
        }
      },
