    {
      "name": "admin_generateLogBloomCache",
      "summary": "Generates cached log bloom indexes for blocks. APIs such as eth_getLogs and eth_getFilterLogs use the cache for improved performance.",
      "params": [
        {
          "$ref": "#/components/contentDescriptors/startBlock"
        },
        {
          "$ref": "#/components/contentDescriptors/endBlock"
        }
      ],
      "result": {
        "$ref": "#/components/contentDescriptors/Logbloom"
      },
      "examples": [
        {
          "name": "generateLogBloomCacheExample",
          "params": [
            {
              "name": "startBlock",
              "value": "0x0"
            },
            {
              "name": "endBlock",
              "value": "0x10000"
            }
          ],
          "result": {
            "name": "generateLogBloomCacheResultExample",
            "value": {
              "startBlock": "0x0",
              "endBlock": "0x10000",
              "currentBlock": "0xd37f",
              "requestAccepted": true,
              "caching": true
            }
          }
        }
      ]
    },
    {
      "name": "admin_logsRemoveCache",
      "summary": "Removes cache files for the specified range of blocks.",
      "params": [
        {
          "name": "fromBlock",
          "required": true,
          "schema": {
            "$ref": "#/components/schemas/BlockNumber"
