        {
          "name": "toBlock",
          "required": true,
          "schema": {
            "$ref": "#/components/schemas/BlockNumber"
          }
        }
      ],
      "result": {
        "name": "logsRemoveCacheResult",
        "description": "Cache Removed status or error",
        "schema": {
          "type": "object",
          "properties": {
            "Status": {
              "type": "string"
            }
          }
        }
      },
      "examples": [
        {
          "name": "logsRemoveCacheExample",
          "params": [
